import './App.css';

function App() {
  return (
    <div className="App">
      <div className="LoginBox">
        <div className="LoginTitle">
          Log in to your Account
        </div>
        <div className="InputLayer">
          Username:
          <input className="TextBox" type="text"/>
        </div>
        <div className="InputLayer">
          Password:
          <input className="TextBox" type="text"/>
        </div>
      </div>
    </div>  
  );
}

export default App;
